import React from "react";

const styles = {
  tableStyle: {
    borderCollapse: "collapse",
    width: "100%",
  },
  tableHeaderStyle: {
    border: "1px solid #dddddd",
    textAlign: "left",
    padding: "8px",
  },
};

class TableComponent extends React.Component {
  render() {
    console.log(this.props.shipmentData.length);
    return (
      <table style={styles.tableStyle}>
        <tr>
          <th style={styles.tableHeaderStyle}>AWB NUMBER</th>
          <th style={styles.tableHeaderStyle}>TRANSPORTER</th>
          <th style={styles.tableHeaderStyle}>SOURCE</th>
          <th style={styles.tableHeaderStyle}>DESTINATION</th>
          <th style={styles.tableHeaderStyle}>START DATE</th>
          <th style={styles.tableHeaderStyle}>ETD</th>
          <th style={styles.tableHeaderStyle}>STATUS</th>
        </tr>
        <tr>
          <td style={styles.tableHeaderStyle}>assd</td>
          <td style={styles.tableHeaderStyle}>assd</td>
          <td style={styles.tableHeaderStyle}>Germany</td>
          <td style={styles.tableHeaderStyle}>asdsd</td>
          <td style={styles.tableHeaderStyle}>Maria Anders</td>
          <td style={styles.tableHeaderStyle}>Germany</td>
          <td style={styles.tableHeaderStyle}>asdsad</td>
        </tr>
        {/* {this.props.shipmentData.length === 0
          ? ""
          : */}
        {this.props.shipmentData.forEach((singleShipmentData) => {
          <tr>
            {console.log9singleShipmentData}
            <td style={styles.tableHeaderStyle}>{singleShipmentData.awbno}</td>
            <td style={styles.tableHeaderStyle}>{singleShipmentData.awbno}</td>
            <td style={styles.tableHeaderStyle}>Germany</td>
            <td style={styles.tableHeaderStyle}>{singleShipmentData.to}</td>
            <td style={styles.tableHeaderStyle}>Maria Anders</td>
            <td style={styles.tableHeaderStyle}>Germany</td>
            <td style={styles.tableHeaderStyle}>{singleShipmentData.current_status}</td>
          </tr>;
        })}
        {/* )} */}
      </table>
    );
  }
}

export default TableComponent;
